Use master
Go
Create database KhoHang
Go

Use KhoHang
Go

Create table users
(
	Username varchar(50) not null primary key,
	Password varchar(50) not null,
	tenNV nvarchar(100),
	diachiNV nvarchar(100),
	dienthoaiNV nvarchar(12)
)
Go

Create table KhachHang
(
	maKH int IDENTITY(1,1) not null,
	tenKH nvarchar(50) not null,
	diaChiKH nvarchar(50) not null,
	dienThoaiKH nvarchar(10) not null,
	primary key(maKH)

)
Go 

Create table MatHang
(
	maMH int IDENTITY(1,1) not null,
	loaiMH nvarchar(50) not null,
	primary key(maMH)
)
Go 

Create table SanPham
(
	maSP int not null IDENTITY(1,1) primary key,
	tenSP nvarchar(50) not null,
	hinhAnh image not null,
	maMH int not null,
	noiNhap nvarchar(50) not null,
	ngayNhap Datetime not null,
	giaTien int not null,
	tonKho int not null,
	FOREIGN KEY (maMH) REFERENCES MatHang(maMH)
)
Go

Create table HoaDon
(
	maHD int NOT NULL IDENTITY(1,1) primary key,
	maKH int not null,
	ngayTao Datetime not null,
	giamgia int,
	tongTien int default 0 not null,
	tiencantra int default 0 not null,
	trangthai nvarchar(50) default N'Chưa thanh toán' not null,
	tenNV varchar(50),
	FOREIGN KEY (tenNV) REFERENCES users(Username),
	FOREIGN KEY (maKH) REFERENCES KhachHang(maKH)
)
Go

Create table ChiTietHoaDon
(
	maCTHD int NOT NULL IDENTITY(1,1) primary key,
	maSP int not null,
	maMH int not null,
	maHD int NOT NULL,
	giaTien int not null,
	soLuong int not null,
	FOREIGN KEY (maMH) REFERENCES MatHang(maMH),
	FOREIGN KEY (maSP) REFERENCES SanPham(maSP),
	FOREIGN KEY (maHD) REFERENCES HoaDon(maHD)
)
Go





